import logo from './logo.svg';
import './App.css';
import './carousel.css';
import Header from './components/Header';

import Footer from './components/Footer';
import About from './template/About';
import Products from './template/Products';
import Blog from './template/Blog';


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <div className="App">

      <Header />
      <main>


        <Footer />
      </main>

      <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/blog">
            <Blog />
          </Route>
          <Route path="/products">
            <Products />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </div>
  );
}

export default App;
